-- Enable FK's

-- https://oracle-base.com/articles/8i/constraint-checking-updates
-- AS A RESULT OF MULTIPLE DEPENDENCIES (CONSTRAINTS)
-- AFTER DISABLING FK CONSTRAINTS IN ORDER TO ARTIFICIALLY POPULATE DATABASE WITH EXAMPLE DATA
-- IN THE CASE SOME TABLES IT IS NECESSARY TO USE 'NOVALIDATE' KEYWORD
-- WHEN ENABLING BACK FK'S. THIS IS AS A RESULT PARENT/CHILD ORPHANT RECORDS AS EXPLAINED ON
-- ORACLE WEBSITE:
-- "... The primary key columns cannot be updated as this would orphan the dependant
-- tables, and the dependant tables cannot be updated prior to the parent table
-- as this would also make them orphans."
-- NOVALIDATE ENABLES TO POPULATE RECORDS WITH DUMP DATA
-- AND ALL THE NEW UPDATES/INSERTS ARE ALIDATED
ALTER TABLE booktitle ENABLE CONSTRAINT FK_book_charge_band;
ALTER TABLE dvdtitle ENABLE CONSTRAINT FK_dvd_charge_band;
ALTER TABLE magazinetitle ENABLE CONSTRAINT FK_magazine_charge_band;
ALTER TABLE bookcopy ENABLE CONSTRAINT FK_book_copy;
ALTER TABLE dvdcopy ENABLE CONSTRAINT FK_dvd_copy;
ALTER TABLE magazinecopy ENABLE CONSTRAINT FK_magazine_copy;
ALTER TABLE titlecategory ENABLE NOVALIDATE CONSTRAINT FK_book_category;
ALTER TABLE titlecategory ENABLE NOVALIDATE CONSTRAINT FK_dvd_category;
ALTER TABLE titlecategory ENABLE NOVALIDATE CONSTRAINT FK_magazine_category;
ALTER TABLE reservation ENABLE CONSTRAINT FK_reservation_member;
ALTER TABLE invoice ENABLE CONSTRAINT FK_invoice_member;
ALTER TABLE copyonloan ENABLE CONSTRAINT FK_copyonloan_invoice;
ALTER TABLE loanarchive ENABLE CONSTRAINT FK_loanarchive_invoice;
ALTER TABLE overduecharge ENABLE CONSTRAINT FK_overduecharge_loanarchive;
ALTER TABLE overduecharge ENABLE CONSTRAINT FK_overduecharge_invoice;

